  false,\n\t\"url\": null,\n\t\"notes\": \"Yellow Bogs in Essex County, Vermont is
  a unique ecological area characterized by boreal, lowland forests and extensive
  bog systems. Within the area, black spruce swamps, lowland bogs and other wetlands
  were delineated into natural area sites and were mapped and described. Endemic plant
  and animal species were also identified and described for each site; many of these
  species are restricted to the Nulhegan Basin, of which Yellow Bogs is a part. Recommendations
  are provided for the  management of the rare plants and natural communities of the
  area.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
